import React from 'react';
const Footer = () => {
  return <div className="w-100">
      <p style={{background: '#292a2b', position:"relative" ,fontSize: '20px', textAlign: "center"}} className="text-white py-4 m-0">made by Shukaze</p>
    </div>;
}
export default Footer;
